local Dress_comps = require('.dressComponents')local set = require('Common.container.set')---@class DressEntity---@field config Dress.ConfigComponent---@field itemInfo Dress.ItemInfoComponent---@field num Dress.NumComponent---@field type_id Dress.Type_idComponentlocal DressEntity = {}function DressEntity:Ctor(...)    self.__base.Ctor(self, ...)end---@return booleanfunction DressEntity:hasConfig()  return self:has(Dress_comps.Config) ~= nilend---@param value DressTemplateData---@returns DressEntityfunction DressEntity:addConfig (value)    self:add(Dress_comps.Config, value)    return selfendfunction DressEntity:replaceConfig (value)    self:replace(Dress_comps.Config, value)    return selfendfunction DressEntity:removeConfig ()    self:remove(Dress_comps.Config)    return selfend---@return booleanfunction DressEntity:hasDestroy()  return self:has(Dress_comps.Destroy) ~= nilend---@return DressEntityfunction DressEntity:setDestroy(v)    if (v ~= self:hasDestroy()) then        if (v) then            self:add(Dress_comps.Destroy, true)        else            self:remove(Dress_comps.Destroy)        end    end    return selfend---@return booleanfunction DressEntity:hasItemInfo()  return self:has(Dress_comps.ItemInfo) ~= nilend---@param value ItemInfo---@returns DressEntityfunction DressEntity:addItemInfo (value)    self:add(Dress_comps.ItemInfo, value)    return selfendfunction DressEntity:replaceItemInfo (value)    self:replace(Dress_comps.ItemInfo, value)    return selfendfunction DressEntity:removeItemInfo ()    self:remove(Dress_comps.ItemInfo)    return selfend---@return booleanfunction DressEntity:hasNum()  return self:has(Dress_comps.Num) ~= nilend---@param value number---@returns DressEntityfunction DressEntity:addNum (value)    self:add(Dress_comps.Num, value)    return selfendfunction DressEntity:replaceNum (value)    self:replace(Dress_comps.Num, value)    return selfendfunction DressEntity:removeNum ()    self:remove(Dress_comps.Num)    return selfend---@return booleanfunction DressEntity:hasType_id()  return self:has(Dress_comps.Type_id) ~= nilend---@param value number---@returns DressEntityfunction DressEntity:addType_id (value)    self:add(Dress_comps.Type_id, value)    return selfendfunction DressEntity:replaceType_id (value)    self:replace(Dress_comps.Type_id, value)    return selfendfunction DressEntity:removeType_id ()    self:remove(Dress_comps.Type_id)    return selfendreturn DressEntity